// src/App.js
import './CSS/stylesBigDesktop.css'
import './CSS/stylesDesktop.css'
import './CSS/stylesAlmostDesktop.css'
import './CSS/stylesLargeTablet.css'
import './CSS/stylesMediumTablet.css'
import './CSS/stylesTablet.css'
import './CSS/stylesMobile.css'
import './CSS/stylesSmallMobile.css'
import './index';
import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Login from './Frontend/Login';
import Register from './Frontend/Register';
import Home from './Frontend/Home'; 
import AdminDashboard from './Frontend/AdminDashboard';
import Wish from './Frontend/Wish';
import Series from './Frontend/Series';
import Movies from './Frontend/Movies';
import SeriesPage from './Frontend/SeriesPage';
import MoviePage from './Frontend/MoviePage';

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Home />} />           {/* Homepage */}
        <Route path="/login" element={<Login />} />     {/* Login page */}
        <Route path="/register" element={<Register />} /> {/* Register page */}
        <Route path="/admin" element={<AdminDashboard />} />{/* Admin page */}
        <Route path="/wish" element={<Wish />} />{/* Wish page */}
        <Route path="/movies" element={<Movies />} />{/* Movies page */}
        <Route path="/series" element={<Series />} />{/* Series page */}
        <Route path="/series/:seriesName" element={<SeriesPage />} /> {/* Specific series page */}
        <Route path="/movies/:movieFolder" element={<MoviePage />} />
      </Routes>
    </Router>
  );
}

export default App;
